import React from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Button } from '@mui/material';

const ProyectosUsuarios = () => {
  const filas = [
    { nombre: 'Nombre1', usuario: 'Usuario 1', perfil: 'Admin' },
    { nombre: 'Nombre2', usuario: 'Usuario 2', perfil: 'Usuario' },
    // ... otros datos
  ];

  const tableContainerStyle = {
    marginTop: '50px',
    marginRight: '80px',
  };

  const buttonStyle = {
    backgroundColor: '#FFF', // Fondo blanco
    color: '#DA291C', // Texto color rojo
    border: '1px solid #DA291C', // Borde rojo
  };

  return (
    <TableContainer component={Paper} style={tableContainerStyle}>
      <Table aria-label="tabla de proyectos y usuarios">
        <TableHead>
          <TableRow>
            <TableCell>Nombre</TableCell>
            <TableCell>Usuario</TableCell>
            <TableCell>Perfil</TableCell>
            <TableCell>Accion</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {filas.map((fila, index) => (
            <TableRow key={index}>
              <TableCell>{fila.nombre}</TableCell>
              <TableCell>{fila.usuario}</TableCell>
              <TableCell>{fila.perfil}</TableCell>
              <TableCell>
                <Button 
                  variant="contained" 
                  style={buttonStyle}
                  startIcon={<img src="images/eliminarIcon.svg" alt="Eliminar" />}
                >
                  Eliminar
                </Button>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default ProyectosUsuarios;
